import React from 'react';

const Index = () => {
    return (
        <div className="bg-gray-300 w-screen h-screen items-center">
            <div className="max-w-6xl mx-auto container px-2">
                <div className="text-center ">
                    <a className="font-bold text-3xl text-gray-700">Josiah Rose</a>
                </div>
            </div>
        </div>
    )
}

export default Index;
